description:
Rename your photos and files easily and quickly
The app 'Rename photos and files', also called 'JcRename', is an easy APP to rename a series of photos or files, is batch rename tool for rename files in the directory.
JcRename is very useful if you want to rename your photos in order to classify and identify them by a name 'expressively defined' instead of a generic sequential number or a date.
Have you visited Venice? Rename your photos as 'Venice' so that you can recall them immediately
Remember that this app can't rename the file extension, if you need this please buy the professional edition.
Try the new
Photo and Files Renamer, professional edition
compared to this free version were introduced the following:
- no advertising;
- the visual aspect and the menu organisation;
- pictures and videos preview was included;
- immediate update of Android Gallery was included;
- the possibility to rename also file extension was included;
- function which allows the to restore the previous files names;
- hidden files and folders management option was included;
- We added the translation in German and Russian;
- We added the automatical numbering in free position;
JcRename is also available for desktop computers at the JavaHouse site http://www.javahouse.altervista.org/crovatto/jcrename_en.html

Metal Ranger is a 2D shooter with a nostalgic feel of the 1980s sci-fi action movies and games.
You are playing as a ranger wearing powerful steel armor.
Your enemies are giant alien mutant insects.
Take advantage of a great variety of deadly weapons Choose from an assault rifle, the M134 Minigun machine gun, a grenade launcher, a laser gun, a plasma gun, and a flamethrower.
Complete missions, earn coins, and get armor and HP upgrades.
Start your journey in the factory compound of a Martian colony and fight your way through eerie industrial underground vaults and narrow metal walkways, on to a futuristic city with a retro / cyberpunk ambience. Test the mettle of your Metal Ranger against a huge armored slug, a gigantic spider, and other truly tough monster bosses.
Neon signs, halos around lights, metal ramps and walkways – add to these the synthwave soundtrack and lots of good old side-scrolling action, and you will get that special feel of the golden era of video games, amusement arcades, and VHS tapes.
Game features:
- modern shoot ‘em up  platform action;
- authentic 3D locations;
- difficulty increases with every completed mission;
- great selection of weapons: assault rifle, flamethrower, the Minigun machine gun, plasma gun, etc.;
– atmospheric soundtrack reminiscent of the 1980s еlectonic music;
- smooth performance even on older devices;
- eight free levels that can be played without internet access.
Metal Ranger is not just another platform shooter. It is an artistic tribute and a confession of love to the bygone era.

Text on photo is a new trend! It’s so easy to write on pictures using our app! 

Sometimes a few words can change everything, so let your photos speak! “Text on photo” is a great app that will turn your photos or pics into inspirational images, birthday or wedding cards that are so easy to share right from the app!

Express yourself: write on pictures and tell everybody how your holidays went or send a unique and sincere message to the one you love.

Enjoy a vast collection of different artworks and carefully handpicked font styles. Use a variety of customization options and add text to photos for exceptional results.

With Text on Photo - TextCandy you can:
- Easily put text on a photo;
- Use different frames for your pictures;
- Crop pictures to the exact size you need;
- Write on photos - create birthday cards and holiday greetings with a stylish text;
- Put text over a photo for a quick note;
- Get the advantage of a user-friendly text photo editor.

No more boring pics. Switch to the “text on pictures” format. Explore your creativity. Text on Photo - share your thoughts with the world.

The
Bible game
for Christians This game contains many puzzles and beautiful pictures of different bible stories from the old testament and the new. Stories like:
• Adam and Eve;
• Noah's Ark;
• David and Goliath;
• the story of Moses and God;
• the birth of the son of God Jesus Christ by the Virgin Mary;
It's a heavenly game to play during Christian holy days like Easter and Christmas.
Lots of fun for you and your Christian family Every picture is cut into small tiles and mixed up. Slide the jigsaw pieces to the right place to create beautiful images. The more you advance, the harder the puzzle gets
Bible Puzzle Game features:
• 55 levels - hours of fun;
• 5 different skill levels
• Star challenge - become the best puzzle player
• Wallpaper selector - save the beautiful pictures or set them as wallpaper
• Free game
